import React from "react";
import Chatbot from "react-chatbot-kit";

export default function Chat2() {
    return(<>
        <div className="App">
          <Chatbot
            config={config}
            messageParser={MessageParser}
            actionProvider={ActionProvider}
          />
        </div>
    </>)
}
